function Dashboard() {
  const [devices, setDevices] = useState([]);

  useEffect(() => {
    fetch("/devices")
      .then((res) => res.json())
      .then((data) => setDevices(data));
  }, []);

  return (
    <div className="dashboard-page">
      <h1>Dashboard</h1>
      {devices.map((device) => (
        <div key={device._id} className="dashboard-device">
          <h2>{device.Name}</h2>
        </div>
      ))}
    </div>
  );
}
